import{r as n,o as e,c as s,a,b as t,F as o,f as r,d as c}from"./app.554c1b80.js";const p={},i=r('<h1 id="errors" tabindex="-1"><a class="header-anchor" href="#errors" aria-hidden="true">#</a> Errors</h1><p>There is no doubt that you have encountered errors while making bots. While errors are instrumental at warning you of what is going wrong, many people are stumped by them and how to track them down and fix them, but don&#39;t worry, we have you covered. This section will be all about diagnosing errors, identifying where they are coming from, and fixing them.</p><h2 id="types-of-errors" tabindex="-1"><a class="header-anchor" href="#types-of-errors" aria-hidden="true">#</a> Types of Errors</h2><h3 id="api-errors" tabindex="-1"><a class="header-anchor" href="#api-errors" aria-hidden="true">#</a> API Errors</h3><p>API Errors or DiscordAPIErrors are thrown by the Discord API when an invalid request carries out. API Errors can be mostly diagnosed using the message that is given. You can further examine errors by inspecting the HTTP method and path used. We will explore tracking these errors down in the next section.</p><p>Example: <code>DiscordAPIError: Cannot send an empty message</code></p><h3 id="discord-js-errors" tabindex="-1"><a class="header-anchor" href="#discord-js-errors" aria-hidden="true">#</a> discord.js errors</h3><p>discord.js errors are thrown by the library itself. They can usually be easily tracked down using the stack trace and error message.</p><p>Example: <code>The messages must be an Array, Collection, or number.</code></p><h3 id="javascript-errors" tabindex="-1"><a class="header-anchor" href="#javascript-errors" aria-hidden="true">#</a> JavaScript errors</h3>',10),l=c("JavaScript errors are thrown by node itself or by discord.js. These errors can easily be fixed by looking at the type of error and the stack trace. You can find a full list of types "),u={href:"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Error",target:"_blank",rel:"noopener noreferrer"},d=c("here"),h=c(" And a list of common js errors "),m={href:"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Errors",target:"_blank",rel:"noopener noreferrer"},k=c("here"),b=c("."),g=r('<p>Example: <code>ReferenceError: &quot;x&quot; is not defined</code></p><h3 id="websocket-and-network-errors" tabindex="-1"><a class="header-anchor" href="#websocket-and-network-errors" aria-hidden="true">#</a> WebSocket and Network errors</h3><p>WebSocket and Network errors are common system errors thrown by Node in response to something wrong with the WebSocket connection. Unfortunately, these errors do not have a concrete solution and can be (usually) fixed by getting a better, more stable, and more robust connection. discord.js will automatically try to reconnect to the WebSocket if an error occurs.</p><p>In version 12, WebSocket errors are handled internally, meaning your process should never crash from them. If you want to log these errors, should they happen, you can listen to the <code>shardError</code> event as shown below.</p><div class="language-javascript ext-js line-numbers-mode"><pre class="language-javascript"><code>client<span class="token punctuation">.</span><span class="token function">on</span><span class="token punctuation">(</span><span class="token string">&#39;shardError&#39;</span><span class="token punctuation">,</span> <span class="token parameter">error</span> <span class="token operator">=&gt;</span> <span class="token punctuation">{</span>\n\tconsole<span class="token punctuation">.</span><span class="token function">error</span><span class="token punctuation">(</span><span class="token string">&#39;A websocket connection encountered an error:&#39;</span><span class="token punctuation">,</span> error<span class="token punctuation">)</span><span class="token punctuation">;</span>\n<span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br></div></div><p>The commonly thrown codes for these errors are:</p><ul><li><code>ECONNRESET</code> - The connection was forcibly closed by a peer, thrown by the loss of connection to a WebSocket due to timeout or reboot.</li><li><code>ETIMEDOUT</code> - A connect or send request failed because the receiving party did not respond after some time.</li><li><code>EPIPE</code> - The remote side of the stream being written to has been closed.</li><li><code>ENOTFOUND</code> - The domain being accessed is unavailable, usually caused by a lack of internet, can be thrown by the WebSocket and HTTP API.</li><li><code>ECONNREFUSED</code> - The target machine refused the connection; check your ports and firewall.</li></ul><h2 id="how-to-diagnose-api-errors" tabindex="-1"><a class="header-anchor" href="#how-to-diagnose-api-errors" aria-hidden="true">#</a> How to diagnose API errors</h2><p>API Errors can be tracked down by adding an event listener for unhandled rejections and looking at the extra info. This can be done by adding this to your main file.</p><div class="language-javascript ext-js line-numbers-mode"><pre class="language-javascript"><code>process<span class="token punctuation">.</span><span class="token function">on</span><span class="token punctuation">(</span><span class="token string">&#39;unhandledRejection&#39;</span><span class="token punctuation">,</span> <span class="token parameter">error</span> <span class="token operator">=&gt;</span> <span class="token punctuation">{</span>\n\tconsole<span class="token punctuation">.</span><span class="token function">error</span><span class="token punctuation">(</span><span class="token string">&#39;Unhandled promise rejection:&#39;</span><span class="token punctuation">,</span> error<span class="token punctuation">)</span><span class="token punctuation">;</span>\n<span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br></div></div><p>The next time you get the error it will show info along the bottom of the error which will look something like this for example:</p><div class="language-json ext-json line-numbers-mode"><pre class="language-json"><code>  name<span class="token operator">:</span> &#39;DiscordAPIError&#39;<span class="token punctuation">,</span>\n  message<span class="token operator">:</span> &#39;Invalid Form Body\\nmessage_id<span class="token operator">:</span> Value <span class="token string">&quot;[object Object]&quot;</span> is not snowflake.&#39;<span class="token punctuation">,</span>\n  path<span class="token operator">:</span> &#39;/api/v7/channels/<span class="token number">638200642359525387</span>/messages/<span class="token punctuation">[</span>object%20Object<span class="token punctuation">]</span>&#39;<span class="token punctuation">,</span>\n  code<span class="token operator">:</span> <span class="token number">50035</span><span class="token punctuation">,</span>\n  method<span class="token operator">:</span> &#39;GET&#39;\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br></div></div><p>All of this information can help you track down what caused the error and how to fix it. In this section, we will run through what each property means.</p><h3 id="message" tabindex="-1"><a class="header-anchor" href="#message" aria-hidden="true">#</a> Message</h3>',14),f=c("The most important part of the error is the message. It tells you what went wrong, which can help you track down where it originates. You can find a full list of messages "),y={href:"https://discord.com/developers/docs/topics/opcodes-and-status-codes#json",target:"_blank",rel:"noopener noreferrer"},w=c("here"),v=c(" in the Discord API Docs."),x=r('<h3 id="path" tabindex="-1"><a class="header-anchor" href="#path" aria-hidden="true">#</a> Path</h3><p>Another helpful piece of information is the path, which tells you what API endpoint the error occurred on. We cannot possibly cover all endpoints, but they are usually very descriptive.</p><p>In the above example, the path tells you that the action was executed in the <code>/channels/</code> scope. The number you see next is the channel&#39;s ID. Next, you can spot the <code>message/</code> scope. The number is again the object&#39;s ID. Combined with the method <code>GET</code> you can conclude, that the bot tried to fetch the message with the id <code>[object Object]</code> from the channel with the ID <code>638200642359525387</code>.</p><p>As the error message tells you <code>[object Object ]</code> is not a valid ID, so you now know where to look for an error! Find out where you pass an object as an ID when trying to fetch a message and fix your code in that location.</p><h3 id="code" tabindex="-1"><a class="header-anchor" href="#code" aria-hidden="true">#</a> Code</h3>',5),j=c("The code is another partial representation of the message, in this case, "),T=a("code",null,"Invalid Form Body",-1),E=c(". You can find a full list of codes "),I={href:"https://discord.com/developers/docs/topics/opcodes-and-status-codes#json-json-error-codes",target:"_blank",rel:"noopener noreferrer"},A=c("here"),S=r('<p>The code is also handy if you want only to handle a specific error. Say you&#39;re trying to delete a message which may or may not be there, and wanted to ignore unknown message errors. This can be done by checking the code, either manually or using discord.js constants.</p><div class="language-javascript ext-js line-numbers-mode"><pre class="language-javascript"><code>message<span class="token punctuation">.</span><span class="token function">delete</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">.</span><span class="token function">catch</span><span class="token punctuation">(</span><span class="token parameter">error</span> <span class="token operator">=&gt;</span> <span class="token punctuation">{</span>\n\t<span class="token comment">// Only log the error if it is not an Unknown Message error</span>\n\t<span class="token keyword">if</span> <span class="token punctuation">(</span>error<span class="token punctuation">.</span>code <span class="token operator">!==</span> <span class="token number">10008</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n\t\tconsole<span class="token punctuation">.</span><span class="token function">error</span><span class="token punctuation">(</span><span class="token string">&#39;Failed to delete the message:&#39;</span><span class="token punctuation">,</span> error<span class="token punctuation">)</span><span class="token punctuation">;</span>\n\t<span class="token punctuation">}</span>\n<span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br></div></div><p>Or using Constants:</p><div class="language-javascript ext-js line-numbers-mode"><pre class="language-javascript"><code>message<span class="token punctuation">.</span><span class="token function">delete</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">.</span><span class="token function">catch</span><span class="token punctuation">(</span><span class="token parameter">error</span> <span class="token operator">=&gt;</span> <span class="token punctuation">{</span>\n\t<span class="token keyword">if</span> <span class="token punctuation">(</span>error<span class="token punctuation">.</span>code <span class="token operator">!==</span> Discord<span class="token punctuation">.</span>Constants<span class="token punctuation">.</span>APIErrors<span class="token punctuation">.</span><span class="token constant">UNKNOWN_MESSAGE</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n\t\tconsole<span class="token punctuation">.</span><span class="token function">error</span><span class="token punctuation">(</span><span class="token string">&#39;Failed to delete the message:&#39;</span><span class="token punctuation">,</span> error<span class="token punctuation">)</span><span class="token punctuation">;</span>\n\t<span class="token punctuation">}</span>\n<span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br></div></div>',4),P=c("You can find a list of constants "),C={href:"https://github.com/discordjs/discord.js/blob/stable/src/util/Constants.js#L552",target:"_blank",rel:"noopener noreferrer"},D=c("here"),N=r('<h3 id="method" tabindex="-1"><a class="header-anchor" href="#method" aria-hidden="true">#</a> Method</h3><p>The final piece of information can tell you a lot about what you tried to do to the path. There are a set of predefined keywords that describe our actions on the path.</p><div class="language-text ext-text line-numbers-mode"><pre class="language-text"><code>GET    - Used to retrieve a piece of data\nPOST   - Used to send a piece of data\nPATCH  - Used to modify a piece of data\nPUT    - Used to replace a piece of data completely\nDELETE - Used to delete a piece of data completely\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br></div></div><p>In this particular example, you can see you are trying to access a piece of data, specifically, a message.</p><h2 id="common-discord-js-and-api-errors" tabindex="-1"><a class="header-anchor" href="#common-discord-js-and-api-errors" aria-hidden="true">#</a> Common discord.js and API errors</h2><h3 id="an-invalid-token-was-provided" tabindex="-1"><a class="header-anchor" href="#an-invalid-token-was-provided" aria-hidden="true">#</a> An invalid token was provided.</h3><p>This is a prevalent error; it originates from a wrong token being passed into <code>client.login()</code>. The most common causes of this error are:</p><ul><li>Not importing the config or env file correctly</li><li>Copying the client secret instead of the bot token (the token is alphanumerical and three parts delimited by a period while the client secret is significantly smaller and one part only)</li><li>Simply showing the token and copying that, instead of clicking regenerate and copying that.</li></ul><div class="custom-container warning"><p class="custom-container-title">WARNING</p><p>Before the release of version 12, there used to be an issue where the token was not prefixed correctly, which resulted in valid tokens being marked as invalid. If you have verified that all of the above is not the case, make sure you have updated discord.js to the current stable version.</p></div><h3 id="request-to-use-token-but-token-was-unavailable-to-the-client" tabindex="-1"><a class="header-anchor" href="#request-to-use-token-but-token-was-unavailable-to-the-client" aria-hidden="true">#</a> Request to use token, but token was unavailable to the client.</h3><p>Another common error–this error originates from the client attempting to execute an action that requires the token but the token not being available. This is most commonly caused by destroying the client and then trying to perform an action.</p><p>This error is also caused by attempting to use a client that has not logged in. Both of the examples below will throw errors.</p><div class="language-javascript ext-js line-numbers-mode"><pre class="language-javascript"><code><span class="token keyword">const</span> <span class="token punctuation">{</span> Client<span class="token punctuation">,</span> Intents <span class="token punctuation">}</span> <span class="token operator">=</span> <span class="token function">require</span><span class="token punctuation">(</span><span class="token string">&#39;discord.js&#39;</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n\n<span class="token comment">// Should not be here!</span>\n<span class="token keyword">const</span> client <span class="token operator">=</span> <span class="token keyword">new</span> <span class="token class-name">Client</span><span class="token punctuation">(</span><span class="token punctuation">{</span> intents<span class="token operator">:</span> <span class="token punctuation">[</span>Intents<span class="token punctuation">.</span><span class="token constant">FLAGS</span><span class="token punctuation">.</span><span class="token constant">GUILDS</span><span class="token punctuation">]</span> <span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n\nmodule<span class="token punctuation">.</span><span class="token function-variable function">exports</span> <span class="token operator">=</span> <span class="token parameter">interaction</span> <span class="token operator">=&gt;</span> <span class="token punctuation">{</span>\n\t<span class="token keyword">const</span> id <span class="token operator">=</span> interaction<span class="token punctuation">.</span>options<span class="token punctuation">.</span><span class="token function">getString</span><span class="token punctuation">(</span><span class="token string">&#39;id&#39;</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n\t<span class="token comment">// Should be `interaction.client` instead!</span>\n\tclient<span class="token punctuation">.</span>users<span class="token punctuation">.</span><span class="token function">fetch</span><span class="token punctuation">(</span>id<span class="token punctuation">)</span><span class="token punctuation">.</span><span class="token function">then</span><span class="token punctuation">(</span><span class="token parameter">user</span> <span class="token operator">=&gt;</span> <span class="token punctuation">{</span>\n\t\tinteraction<span class="token punctuation">.</span><span class="token function">reply</span><span class="token punctuation">(</span><span class="token template-string"><span class="token template-punctuation string">`</span><span class="token string">Your requested user: </span><span class="token interpolation"><span class="token interpolation-punctuation punctuation">${</span>user<span class="token punctuation">.</span>tag<span class="token interpolation-punctuation punctuation">}</span></span><span class="token template-punctuation string">`</span></span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n\t<span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br><span class="line-number">8</span><br><span class="line-number">9</span><br><span class="line-number">10</span><br><span class="line-number">11</span><br><span class="line-number">12</span><br></div></div><div class="language-javascript ext-js line-numbers-mode"><pre class="language-javascript"><code><span class="token keyword">const</span> <span class="token punctuation">{</span> Client<span class="token punctuation">,</span> Intents <span class="token punctuation">}</span> <span class="token operator">=</span> <span class="token function">require</span><span class="token punctuation">(</span><span class="token string">&#39;discord.js&#39;</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n\n<span class="token keyword">const</span> client <span class="token operator">=</span> <span class="token keyword">new</span> <span class="token class-name">Client</span><span class="token punctuation">(</span><span class="token punctuation">{</span> intents<span class="token operator">:</span> <span class="token punctuation">[</span>Intents<span class="token punctuation">.</span><span class="token constant">FLAGS</span><span class="token punctuation">.</span><span class="token constant">GUILDS</span><span class="token punctuation">]</span> <span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n\nclient<span class="token punctuation">.</span><span class="token function">on</span><span class="token punctuation">(</span><span class="token string">&#39;interactionCreate&#39;</span><span class="token punctuation">,</span> someHandlerFunction<span class="token punctuation">)</span><span class="token punctuation">;</span>\n\nclient<span class="token punctuation">.</span><span class="token function">login</span><span class="token punctuation">(</span><span class="token string">&#39;your-token-goes-here&#39;</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n<span class="token comment">// client will not be logged in yet!</span>\nclient<span class="token punctuation">.</span>users<span class="token punctuation">.</span><span class="token function">fetch</span><span class="token punctuation">(</span><span class="token string">&#39;myId&#39;</span><span class="token punctuation">)</span><span class="token punctuation">.</span><span class="token function">then</span><span class="token punctuation">(</span>someInitFunction<span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br><span class="line-number">7</span><br><span class="line-number">8</span><br><span class="line-number">9</span><br></div></div><h3 id="messageembed-field-names-may-not-be-empty" tabindex="-1"><a class="header-anchor" href="#messageembed-field-names-may-not-be-empty" aria-hidden="true">#</a> MessageEmbed field names may not be empty.</h3><p>This error originates from calling <code>MessageEmbed.addFields()</code> with a field object&#39;s <code>name</code> property as an empty string. If you would like the title to be empty for a reason, you should use a zero width space, which can be input as <code>\\u200b</code>.</p><h3 id="messageembed-field-values-may-not-be-empty" tabindex="-1"><a class="header-anchor" href="#messageembed-field-values-may-not-be-empty" aria-hidden="true">#</a> MessageEmbed field values may not be empty.</h3><p>In conjunction with the previous error, this error results from calling <code>MessageEmbed.addFields()</code> with a field object&#39;s <code>value</code> property as an empty string. You can use a zero-width space if you would like this blank.</p><h3 id="the-messages-must-be-an-array-collection-or-number" tabindex="-1"><a class="header-anchor" href="#the-messages-must-be-an-array-collection-or-number" aria-hidden="true">#</a> The messages must be an Array, Collection, or number.</h3><p>This error originates from an invalid call to <code>bulkDelete()</code>. Make sure you are inputting a valid Array or Collection of messages or a valid number.</p><h3 id="members-didn-t-arrive-in-time" tabindex="-1"><a class="header-anchor" href="#members-didn-t-arrive-in-time" aria-hidden="true">#</a> Members didn&#39;t arrive in time.</h3><p>Another common error–this error originates from the client requesting members from the API through the WebSocket and the member chunks not arriving in time and triggering the timeout. The most common cause of this error is a bad connection; however, it can also be caused by fetching many members, upwards of 50 thousand. To fix this, run the bot on a location with better internet, such as a VPS. If this does not work for you, you will have to manually change the hardcoded member fetching timeout in the source code.</p><h3 id="maxlistenersexceededwarning-possible-eventemitter-memory-leak-detected" tabindex="-1"><a class="header-anchor" href="#maxlistenersexceededwarning-possible-eventemitter-memory-leak-detected" aria-hidden="true">#</a> MaxListenersExceededWarning: Possible EventEmitter memory leak detected...</h3><p>This error is caused by spawning a large number of event listeners, usually for the client. The most common cause of this is nesting your event listeners instead of separating them. The way to fix this error is to make sure you do not nest your listeners; it is <strong>not</strong> to use <code>emitter.setMaxListeners()</code> as the error suggests.</p><p>You can debug these messages in different ways:</p>',25),U=c("Through the "),W={href:"https://nodejs.org/api/cli.html#cli_trace_warnings",target:"_blank",rel:"noopener noreferrer"},_=c("CLI"),O=c(": "),F=a("code",null,"node --trace-warnings index.js",-1),M=c("Through the "),q={href:"https://nodejs.org/api/process.html#process_event_warning",target:"_blank",rel:"noopener noreferrer"},L=a("code",null,"process#warning",-1),G=c(" event"),Y=c(": "),R=a("code",null,"process.on('warning', console.warn);",-1),H=r('<h3 id="cannot-send-messages-to-this-user" tabindex="-1"><a class="header-anchor" href="#cannot-send-messages-to-this-user" aria-hidden="true">#</a> Cannot send messages to this user.</h3><p>This error throws when the bot attempts to send a DM message to a user but cannot do so. A variety of reasons causes this:</p><ul><li>The bot and the user do not share a guild (often, people attempt to dm the user after kicking or banning them).</li><li>The bot tries to DM another bot.</li><li>The user has blocked the bot.</li><li>The user has disabled dms in the privacy settings.</li></ul><p>In the case of the last two reasons, the error is not preventable, as the Discord API does not provide a way to check if you can send a user a dm until you attempt to send one. The best way to handle this error is to add a <code>.catch()</code> where you try to dm the user and either ignore the rejected Promise or do what you want because of it.</p><h2 id="common-miscellaneous-errors" tabindex="-1"><a class="header-anchor" href="#common-miscellaneous-errors" aria-hidden="true">#</a> Common miscellaneous errors</h2><h3 id="code-enoent-syscall-spawn-git" tabindex="-1"><a class="header-anchor" href="#code-enoent-syscall-spawn-git" aria-hidden="true">#</a> code ENOENT... syscall spawn git.</h3><p>This error is commonly thrown by your system due to it not finding <code>git</code>. You need to install <code>git</code> or update your path if <code>git</code> is already installed. Here are the download links for it:</p>',7),z=a("li",null,[c("Ubuntu/Debian: "),a("code",null,"sudo apt-get install git")],-1),B=c("Windows: "),J={href:"https://git-scm.com/download/win",target:"_blank",rel:"noopener noreferrer"},V=c("git-scm"),K=r('<h3 id="code-elifecycle" tabindex="-1"><a class="header-anchor" href="#code-elifecycle" aria-hidden="true">#</a> code ELIFECYCLE</h3><p>This error is commonly thrown by your system in response to the process unexpectedly closing. Cleaning the npm cache and deleting node_modules can usually fix it. The instructions for doing that are as such:</p><ul><li>Clean npm cache with <code>npm cache clean --force</code></li><li>delete <code>node_modules</code></li><li>delete <code>package-lock.json</code> (make sure you have a <code>package.json</code>!)</li><li>run <code>npm install</code> to reinstall packages from <code>package.json</code></li></ul>',3);p.render=function(r,c){const p=n("OutboundLink");return e(),s(o,null,[i,a("p",null,[l,a("a",u,[d,t(p)]),h,a("a",m,[k,t(p)]),b]),g,a("p",null,[f,a("a",y,[w,t(p)]),v]),x,a("p",null,[j,T,E,a("a",I,[A,t(p)])]),S,a("p",null,[P,a("a",C,[D,t(p)])]),N,a("ul",null,[a("li",null,[U,a("a",W,[_,t(p)]),O,F]),a("li",null,[M,a("a",q,[L,G,t(p)]),Y,R])]),H,a("ul",null,[z,a("li",null,[B,a("a",J,[V,t(p)])])]),K],64)};export{p as default};
